import 'bootstrap/dist/css/bootstrap.min.css';
import image1 from '../../assets/registration-updated.jpg';
const Registration=()=>{

    return(
        <>
            <section class="text-center">
                <div class="p-5 bg-image" style={{backgroundImage:image1,height:'300px'}} />
                <div class="card mx-4 mx-md05 shadow-5-strong"
                     style={{marginTop:'-100px',background:'hsla(0,0%,100%,0.8)',backdropFilter:'blur(30px'}}>


                </div>
                
            </section>

        </>
    )
}

export default Registration;
